import React, { Component } from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import CreateTodo from "./components/create_todo.component";
import EditTodo from "./components/edit_todo.component";
import TodosList from "./components/todos_list.component";
import logo from "./logo.svg";

import axios from 'axios';

require('dotenv').config();

console.log(process.env.MERN_APP_ENDPOINT);
axios.defaults.baseURL = process.env.MERN_APP_ENDPOINT;

class App extends Component {
  render() {
    return (
      <Router>
        <div className="container">
          <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <a className="navbar-brand" href="http://elonhangyang.com" target="_blank" rel="noopener noreferrer">
              <img src={logo} width="30" height="30" alt="elonhangyang.com" />
            </a>
            <Link to="/" className="navbar-brand">MERN-Stack Todo App</Link>
            <div className="collpase navbar-collapse">
              <ul className="navbar-nav mr-auto">
                <li className="navbar-item">
                  <Link to="/" className="nav-link">Todos</Link>
                </li>
                <li className="navbar-item">
                  <Link to="/create" className="nav-link">Create Todo</Link>
                </li>
              </ul>
            </div>
          </nav>
          <br/>
          <Route path="/" exact component={TodosList} />
          <Route path="/edit/:id" component={EditTodo} />
          <Route path="/create" component={CreateTodo} />
        </div>
      </Router>
    );
  }
}
export default App;
